CREATE TABLE `user_action_log` (
  `id` int NOT NULL AUTO_INCREMENT,
  `user_id` int NOT NULL,
  `target_user_id` int DEFAULT NULL,
  `target_svg_id` int DEFAULT NULL,
  `action_type` enum('follow','unfollow','like','unlike') COLLATE utf8mb4_unicode_ci NOT NULL,
  `created_at` datetime DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  KEY `fk_action_user` (`user_id`),
  KEY `fk_action_target_user` (`target_user_id`),
  KEY `fk_action_svg` (`target_svg_id`),
